import React, {useContext, useEffect} from 'react';
import CardOut from "./CardOut";
import ChildCard from "./ChildCard";
import axios from "axios";
import {UserId} from "../App";

const History = () => {
    const { user } = useContext(UserId);
    function getHistoryOuts(){
        axios.get(`http://91.77.160.177:4001/get_history_user/${user.id}`).then((response) => {
            console.log(response);
        })
    }

    useEffect(() => {
        getHistoryOuts()
    }, []);
    return (
        <div className={'card-out-list'} style={{width:'100%'}}>
            <ChildCard childCard={{fullName:'Бобров'}}/>
        </div>
    );
};

export default History;
